import React from 'react';
import styles from './index.css';
import visa_mcard from './files/img/visa_mcard.png';
import visa_mcard_color from './files/img/visa_mcard_color.png';
import qiwi from './files/img/qiwi.png';
import qiwi_color from './files/img/qiwi_color.png';
import yandex from './files/img/yandex.png';
import yandex_color from './files/img/yandex_color.png';
import webmoney from './files/img/webmoney.png';
import webmoney_color from './files/img/webmoney_color.png';
import skrill from './files/img/skrill.png';
import skrill_color from './files/img/skrill_color.png';

class MainContent extends React.Component
{
	render ()
	{
		return (
			<div>
				<div className="main_container">
        			<div className="main_content">
        				<p id="payment">Выберите способ оплаты</p>
        				<p className="main_content_text">Банковские карты</p>
        				<img src={visa_mcard} alt="visa & mcard" onMouseOver={() => this.src={visa_mcard}} onMouseOut={() => this.src={visa_mcard_color}} />
          				<p className="main_content_text">Электронные платежные системы</p>
          				<div className="cards_container">
							<img src={qiwi} alt="qiwi_card" onMouseOver={() => this.src={qiwi_color}} onMouseOut={() => this.src={qiwi_color}} />
							<img src={yandex} alt="yandex_card" onMouseOver={() => this.src={yandex_color}} onMouseOut={() => this.src={yandex}} />
							<img src={webmoney} alt="webmoney_card" onMouseOver={() => this.src={webmoney_color}} onMouseOut={() => this.src={webmoney}} />
							<img src={skrill} alt="skrill_card" onMouseOver={() => this.src={skrill_color}} onMouseOut={() => this.src={skrill}} />
						</div>
    				</div>
    			</div>
    		</div>
		)
	}
}
export default MainContent;
